syntax = "proto3";
package usercenter;

import "github.com/golang/protobuf/ptypes/timestamp/timestamp.proto";

option go_package = "models";

message TUsersubsStatus {
	string userid = 1;
	string status = 2;
	google.protobuf.Timestamp validtime1 = 3;
	google.protobuf.Timestamp validtime2 = 4;
	string mbiquto = 5;
}

